import styled from 'styled-components'

export const AddUserDiv = styled.div`
    -webkit-transition: all 1s, -webkit-transform 1s;
    transition: all 1s, transform 1s;
    width:100%;
    height:70%;
    opacity:1;
    background-color:white;
    margin-top:20%;
    padding:2em;
    box-sizing:border-box;
`;
